import React from "react";
import { TAGS } from "./Tags";

const skills = [
  TAGS.HTML,
  TAGS.JS,
  TAGS.CSS,
  TAGS.TAILWIND,
  TAGS.WORDPRESS,
  TAGS.PHP,
];

const Skills = () => {
  return (
    <section id="my-skills" className="bg-opacity-0 text-white py-10 px-8">
    <h2 className="text-3xl font-bold text-center mb-6">Habilidades</h2>
    <div className="relative p-[4px] rounded-lg">
      {/* Contenedor principal con los Ã­conos */}
      <div className="relative bg-opacity-0 p-6 rounded-lg grid grid-cols-3 sm:grid-cols-4 lg:grid-cols-6 gap-3 place-items-center">
        {skills.map((skill, index) => (
          <div key={index} className="flex flex-col items-center gap-1">
            {skill.icon}
            <span className="text-sm">{skill.name}</span>
          </div>
        ))}
      </div>
    </div>
  </section>
  );
};

export default Skills;
